import React from "react";
import { Link } from "react-router-dom";
import { Accordion, Button, makeStyles, AccordionSummary, ButtonGroup, AccordionDetails, ClickAwayListener } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
   button:{
      position:"relative",
      overflow:"hidden",
      display:"flex",
      flexDirection:"column",
      justifyContent:"left",
      color:"white",
      borderRadius:"5px",
      textDecoration:"none",
      background:"transparent",
      border:"currentColor",
      fontSize:"15px",
      padding:"10px",
      '&:hover':{
      backgroundColor:"#2a3576",
      opacity:"0.5",
      transition:"background-color 250ms \
                  cubic-bezier(0.4, 0, 0.2, 1) 0ms,box-shadow \
                  250ms cubic-bezier(0.4, 0, 0.2, 1) 0ms,border \
                  250ms cubic-bezier(0.4, 0, 0.2, 1) 0ms",
    }
   }
}));

function CoachTools(){

   const classes = useStyles();

   return(
      <div>
         <Accordion>
            <AccordionSummary>
               Coach Tools
            </AccordionSummary>
            <AccordionDetails>
               <p>hello</p>
            </AccordionDetails>
         </Accordion>
      </div>
   );
}

export default CoachTools;
